# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.db.models.Model~Subclass
    - djconfig
    - Member[models].Member[Config]
  - - django.forms.BaseForm~Subclass
    - djconfig
    - Member[conf].Member[_ConfigFormBase]
  - - django.forms.BaseForm~Subclass
    - djconfig
    - Member[forms].Member[ConfigForm]
